import logo from './logo.svg';
import './App.css';
import './components/NavCustom.js';

import Container from 'react-bootstrap/Container';
import NavCustom from './components/NavCustom.js';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Stack from 'react-bootstrap/Stack';


function AdContent(){
  return (
    <Card style={{ width: '25rem' , height: '10rem' }} className="rounded">
        <Card.Img variant="top" src="holder.js/100px180" />       

      </Card>
  );
}

function CardsCustom() {
  return (
    <div className='lg m-0 p-3'>
      <Card style={{ width: '25rem'}} className="rounded">
        <Card.Img variant="top" src="holder.js/100px180" />
        <Card.Body>
          <Card.Title className="text-dark">Card Title</Card.Title>
          <Card.Text className="text-dark">
            Some quick example text to build on the card title and make up the
            bulk of the card's content.
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
    </div>
  );
}

function HomeContent() {
  return (
    <div className='m-2 p-3'>

      <Container fluid expand="lg">
        {/* <Stack direction='horizontal'> */}
          <Row>
            <Col>
              <Row>
                <CardsCustom />                                
                <CardsCustom />                
              </Row>
              <Row>
                <Col>
                <CardsCustom />
                </Col>
                <Col>
                  <CardsCustom />
                </Col>
              </Row>
            </Col>
            <Col>
              <AdContent/>
            </Col>
          </Row>
        {/* </Stack> */}
      </Container>
    </div >
  );
}


function App() {
  return (

    <div className="App">
      <header className="App-header">
        <NavCustom />
      </header>
      <body className='App-body ww-100 text-white'>


        <HomeContent />
      </body>
    </div>
  );
}

export default App;
